import React, { useState, useEffect } from "react";
import './team.css';
import img01 from '../../../assets/img/aboutus/team/ancil.png';
import img02 from '../../../assets/img/aboutus/team/sundas.png';
import img03 from '../../../assets/img/aboutus/team/borna.png';
import img04 from '../../../assets/img/aboutus/team/neethu.png';
import Slider from 'react-slick';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';

const Team = () => {
  const [isSlider, setIsSlider] = useState(true);

  useEffect(() => {
    const handleResize = () => {
      if (window.innerWidth < 450) {
        setIsSlider(true);
      } else {
        setIsSlider(false);
      }
    };

    window.addEventListener('resize', handleResize);
    handleResize(); // Call the function once on initial load

    return () => {
      window.removeEventListener('resize', handleResize);
    };
  }, []);

  const settings = {
    
    infinite: true,
    speed: 5000,
    slidesToShow: isSlider ? 2 : 2,
    slidesToScroll: 4,
    autoplay: false,
    autoplaySpeed: 5000,
  };

  return (
    <>
      {isSlider ? (
        <Slider {...settings}>
          <div className="img000">
            <img src={img01} alt="Image 1" style={{height:"230px"}} />
          </div>
          <div className="img000">
            <img src={img02} alt="Image 2" style={{height:"230px"}} />
          </div>
          <div className="img000">
            <img src={img03} alt="Image 3"style={{height:"230px"}}  />
          </div>
          <div className="img000">
            <img src={img04} alt="Image 4"style={{height:"230px"}}  />
          </div>
          <div className="img000">
            <img src={img04} alt="Image 5"style={{height:"230px"}}  />
          </div>
        </Slider>
      ) : (
        <div className="team-grid">
          <img src={img01} alt="Image 1" />
          <img src={img02} alt="Image 2" />
          <img src={img03} alt="Image 3" />
          <img src={img04} alt="Image 4" />
        </div>
        
      )}
            {isSlider ? (
        <Slider {...settings}>
          <div className="img000">
            <img src={img01} alt="Image 1"  style={{height:"230px"}} />
          </div>
          <div className="img000">
            <img src={img02} alt="Image 2" style={{height:"230px"}} />
          </div>
          <div className="img000">
            <img src={img03} alt="Image 3" style={{height:"230px"}} />
          </div>
          <div className="img000">
            <img src={img04} alt="Image 4" style={{height:"230px"}} />
          </div>
          <div className="img000">
            <img src={img04} alt="Image 5" style={{height:"230px"}}  />
          </div>
        </Slider>
      ) : (
        <div className="team-grid">
          <img src={img01} alt="Image 1" />
          <img src={img02} alt="Image 2" />
          <img src={img03} alt="Image 3" />
          <img src={img04} alt="Image 4" />
        </div>
        
      )}
    </>
  );
}

